import React from 'react';

function History({ history }) {
  return (
    <div>
      <h2>Chat History</h2>
      <ul>
        {history.map((chat, index) => (
          <li key={index}>
            <p>{chat.message}</p>
            <span>{new Date(chat.timestamp).toLocaleString()}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default History;
